  [],\n\t\"revision_timestamp\": \"2016-07-27T22:52:12.826388\",\n\t\"name\": \"lostwood-national-wildlife-refuge-and-lostwood-wetland-mgmt-district-annual-narrative-repo\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Lostwood
  NWR, Lostwood WMD, and Shell Lake NWR outlines Refuge accomplishments during the
  1976 calendar year. The report begins with an introduction to the Refuge and information
  about weather conditions, habitat conditions, land acquisition activities, and the
  system status. Construction, maintenance, and wildfires are also described. Habitat
  management is covered; grasslands, wetlands, forests, wilderness areas, and easements
  for waterfowl management are discussed. The wildlife section of the report discusses
  migratory birds, mammals, and non-migratory birds. Interpretation and recreation
  activities are outlined; topics include information and interpretation, recreation,
  and law enforcement. Field investigations, items of interest, safety information,
  and newspaper articles are attached.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
